$watchAll(['passport', 'birth_date'], getPassportData);

$w('programs', (val) => {
  $setVal('program_name', $option('programs').name)
})

function getPassportData(val) {
  let passport = val[0];
  let birth_date = val[1]
  if (passport!= null && passport.length === 9 && birth_date != undefined) {
    const a = passport.substring(0,2).toUpperCase();
    const b = passport.substring(2);
    $setVal('passport', a+b);
    const url= 'v1/tax/passport2?series=' + a + '&number=' + b + '&birth_date=' + birth_date;
    $form.$api.get(url).then((root) => {
      const apiData = root.data.data.info.data;
      console.log(root)
      $setVal('region_id', apiData.region_id);
      $setVal('district_code', apiData.district_id);
      $setVal('tin', apiData.tin>0 ? apiData.tin : '');
      $setVal('pinfl', apiData.pinfl);
    }).catch((e) => {
      const message = e.response.data.message || e.message;

      $form.errorToast(
        message.indexOf('"') != -1
          ? message.substr( message.indexOf('"') + 1, message.length - message.indexOf('"') - 2)
          : message
      )
  	});
  }
}

this.beforeSave = () => {
  delete $data.programs
}

